import React from "react";
import { useNavigate } from "react-router-dom";


const Homepage = () => {
  const navigate = useNavigate();
  return (
 <div>  
      <div >
        <div p={2}>
          <h2>
            AI ChatBot
          </h2>
          <div
            onClick={() => navigate("/chatbot")} >
            <div p={3} pt={0}>
              <h2>
                Chatbot
              </h2>
              <h1>Chat With AI Chatbot</h1>
            </div>
          </div>
        </div>


        </div>


      </div>
  );
};

export default Homepage;
